import React, { Component } from "react";
import { Table } from "antd";

export default class ChildReleaseList extends Component {


    constructor(props) {
        super(props);
        this.state = {
            childColumns: [

                {
                    title: 'Status',
                    dataIndex: 'status',
                    key: 'status',
                    editable: true,
                },
                {
                    title: 'Progess',
                    dataIndex: 'progress',
                    key: 'progress',
                    editable: true,
                },
                {
                    title: 'Start Date',
                    dataIndex: 'startDate',
                    key: 'startDate',
                    editable: true,
                },
                {
                    title: 'End Date',
                    dataIndex: 'endDate',
                    key: 'endDate',
                    editable: true,
                },
                {
                    title: 'Description',
                    dataIndex: 'description',
                    key: 'description',
                    editable: true,
                },
            ],
        }
    }


    render() {
        return (

            <Table
                columns={this.state.childColumns}
                dataSource={this.props.record.childRelease}
                pagination={false} />
        )
    }

}
